import { View, Text } from 'react-native';
import styled from 'styled-components/native';

/*
interface props {
    infoTitle : string; //  ' : ' 는 필수항목, ' ?: ' 는 필수항목 X
    infoContent : string;
}*/
const SC = {
    storeInfoWrap: styled.View`
        flex-Direction: row;
        justify-Content: space-between;
        margin-Bottom: 10px;
    `,
    storeInfoTitle: styled.Text`
        font-Family: Regular;
        font-Size: 12px;
        color: gray;
    `,
    storeInfoText: styled.Text`
        font-Family: Meduim;
        font-Size: 12px;
        color: gray;
    `
}
const StoreInfoEle = ({ infoTitle, infoContent }) => {
    return (
        <SC.storeInfoWrap>
            <SC.storeInfoTitle>asdasd</SC.storeInfoTitle>
            <SC.storeInfoText>asasd</SC.storeInfoText>
        </SC.storeInfoWrap>
    )
}


export default StoreInfoEle;
